struct Solution;
impl Solution {
    #[allow(dead_code)]
    pub fn can_make_palindrome_queries(s: String, queries: Vec<Vec<i32>>) -> Vec<bool> {
        let s = s
            .into_bytes()
            .into_iter()
            .map(|x| x as char)
            .collect::<Vec<_>>();
        let len = s.len() / 2;
        let mut hm = std::collections::HashMap::<Vec<i32>, bool>::new();
        queries
            .into_iter()
            .map(|x| match hm.entry(x.clone()) {
                std::collections::hash_map::Entry::Occupied(val) => *val.get(),
                std::collections::hash_map::Entry::Vacant(v) => *v.insert(Self::inner(
                    &s[..len],
                    &s[len..],
                    (x[0] as usize, x[1] as usize),
                    (x[2] as usize - len, x[3] as usize - len),
                )),
            })
            .collect::<Vec<_>>()
    }
    fn prepare_table(s: &[char]) -> [usize; 26] {
        let mut ret = [0; 26];
        s.iter().for_each(|&x| {
            ret[x as usize - 'a' as usize] += 1;
        });
        ret
    }

    fn inner(
        s1: &[char],
        s2: &[char],
        (left1, right1): (usize, usize),
        (left2, right2): (usize, usize),
    ) -> bool {
        let mut l1 = 0;
        let mut r2 = s2.len() - 1;
        while l1 < left1 && r2 > right2 {
            let c = s1[l1];
            if c != s2[r2] {
                return false;
            }
            l1 += 1;
            r2 -= 1;
        }
        let mut r1 = s1.len() - 1;
        let mut l2 = 0;
        while r1 > right1 && l2 < left2 {
            let c = s1[r1];
            if c != s2[l2] {
                return false;
            }
            r1 -= 1;
            l2 += 1;
        }
        // println!("{l1}, {left1}, {r1}, {right1}");
        // println!("{l2}, {left2}, {r2}, {right2}");
        if l1 == left1 && r1 == right1 || l2 == left2 && r2 == right2 {
            Self::prepare_table(&s1[l1..=r1]) == Self::prepare_table(&s2[l2..=r2])
        } else {
            // println!("s1: {:?}, l1: {l1}, r1: {r1}", s1);
            // println!("s2: {:?}, l2: {l2}, r2: {r2}", s2);
            let (a1, b1, _) = (left1 - l1, right1 - left1 + 1, r1 - right1);
            let (_, b2, c2) = (left2 - l2, right2 - left2 + 1, r2 - right2);
            let mut table1 = Self::prepare_table(&s1[left1..=right1]);
            let mut table2 = Self::prepare_table(&s2[left2..=right2]);
            if a1 == 0 {
                if b1 >= c2 {
                    while r2 > right2 {
                        let idx = s2[r2] as usize - 'a' as usize;
                        if table1[idx] == 0 {
                            return false;
                        }
                        table1[idx] -= 1;
                        r2 -= 1;
                    }
                    while r1 > right1 {
                        let idx = s1[r1] as usize - 'a' as usize;
                        if table2[idx] == 0 {
                            return false;
                        }
                        table2[idx] -= 1;
                        r1 -= 1;
                    }
                    table1 == table2
                } else {
                    for _ in left1..=right1 {
                        let idx = s2[r2] as usize - 'a' as usize;
                        if table1[idx] == 0 {
                            return false;
                        }
                        table1[idx] -= 1;
                        r2 -= 1;
                    }
                    for _ in left2..=right2 {
                        let idx = s1[r1] as usize - 'a' as usize;
                        if table2[idx] == 0 {
                            return false;
                        }
                        table2[idx] -= 1;
                        r1 -= 1;
                    }
                    Self::is_palindrome(&s1[right1 + 1..=r1], &s2[right2 + 1..=r2])
                }
            } else {
                if b2 >= a1 {
                    while l1 < left1 {
                        let idx = s1[l1] as usize - 'a' as usize;
                        if table2[idx] == 0 {
                            return false;
                        }
                        table2[idx] -= 1;
                        l1 += 1;
                    }
                    while l2 < left2 {
                        let idx = s2[l2] as usize - 'a' as usize;
                        if table1[idx] == 0 {
                            return false;
                        }
                        table1[idx] -= 1;
                        l2 += 1;
                    }
                    table1 == table2
                } else {
                    for _ in left1..=right1 {
                        let idx = s2[l2] as usize - 'a' as usize;
                        if table1[idx] == 0 {
                            return false;
                        }
                        table1[idx] -= 1;
                        l2 += 1;
                    }
                    for _ in left2..=right2 {
                        let idx = s1[l1] as usize - 'a' as usize;
                        if table2[idx] == 0 {
                            return false;
                        }
                        table2[idx] -= 1;
                        l1 += 1;
                    }
                    Self::is_palindrome(&s1[l1..left1], &s2[l2..left2])
                }
            }
        }
    }
    fn is_palindrome(s1: &[char], s2: &[char]) -> bool {
        s1.iter().zip(s2.iter().rev()).all(|(x, y)| *x == *y)
    }
    #[allow(dead_code)]
    pub fn can_make_palindrome_queries_2(s: String, queries: Vec<Vec<i32>>) -> Vec<bool> {
        let s = s
            .into_bytes()
            .into_iter()
            .map(|x| x as char)
            .collect::<Vec<_>>();
        let n = s.len();
        let mut nokv = vec![0; n];
        nokv[0] = if s[0] != s[n - 1] { 1 } else { 0 };
        for i in 1..n {
            nokv[i] = nokv[i - 1] + if s[i] != s[n - i - 1] { 1 } else { 0 };
        }
        let okay = |i: i32, j: i32| -> bool {
            if i > j {
                true
            } else {
                let i = i as usize;
                let j = j as usize;
                (nokv[j] - if i == 0 { 0 } else { nokv[i - 1] }) == 0
            }
        };

        let mut cnt = vec![vec![0; 26]; n];
        for i in 0..n {
            if i > 0 {
                cnt[i] = cnt[i - 1].clone();
            }
            cnt[i][s[i] as usize - 'a' as usize] += 1;
        }

        let chkc = |a: usize, b: usize, c: usize, d: usize| -> bool {
            for j in 0..26 {
                let v1 = cnt[b][j] - if a == 0 { 0 } else { cnt[a - 1][j] };
                let v2 = cnt[d][j] - if c == 0 { 0 } else { cnt[c - 1][j] };
                if v1 != v2 {
                    return false;
                }
            }
            true
        };

        let le = |v1: &[i32], v2: &[i32]| {
            for j in 0..v1.len() {
                if v1[j] > v2[j] {
                    return false;
                }
            }
            return true;
        };

        let sub = |v1: &[i32], v2: &[i32]| {
            let mut ret = v1.to_vec();
            for j in 0..v1.len() {
                ret[j] -= v2[j];
            }
            ret
        };

        let gv = |i: usize, j: usize| {
            if i > j {
                return vec![0; 26];
            }
            if i > 0 {
                return sub(&cnt[j], &cnt[i - 1]);
            }
            cnt[j].clone()
        };

        let spacp = |a: usize, b: usize, c: usize, d: usize| {
            // let ap = n - b - 1;
            let bp = n - a - 1;
            // let cp = n - d - 1;
            let dp = n - c - 1;

            let big_a = gv(b + 1, dp);
            let big_b = gv(c, d);
            if !le(&big_a, &big_b) {
                return false;
            }
            let big_d = gv(d + 1, bp);
            let big_e = gv(a, b);
            if !le(&big_d, &big_e) {
                return false;
            }
            let big_f = sub(&big_e, &big_d);
            let big_c = sub(&big_b, &big_a);
            big_c == big_f
        };
        let spcpa = |a: usize, b: usize, c: usize, d: usize| {
            let ap = n - b - 1;
            // let bp = n - a - 1;
            let cp = n - d - 1;
            // let dp = n - c - 1;

            let big_a = gv(cp, a - 1);
            let big_b = gv(c, d);
            if !le(&big_a, &big_b) {
                return false;
            }
            let big_c = sub(&big_b, &big_a);
            let big_d = gv(ap, c - 1);
            let big_e = gv(a, b);
            if !le(&big_d, &big_e) {
                return false;
            }
            let big_f = sub(&big_e, &big_d);
            big_c == big_f
        };
        let ga = |a: usize, b: usize, c: usize, d: usize| {
            let ap = n - b - 1;
            let bp = n - a - 1;
            let cp = n - d - 1;
            let dp = n - c - 1;
            let mut ok = true;
            if a <= cp && dp <= b {
                ok = ok && okay(0, a as i32 - 1);
                ok = ok && okay(b as i32 + 1, n as i32 / 2 - 1);
                ok = ok && chkc(a, b, ap, bp);
                return ok;
            }
            if cp <= a && b <= dp {
                ok = ok && okay(0, cp as i32 - 1);
                ok = ok && okay(dp as i32 + 1, n as i32 / 2 - 1);
                ok = ok && chkc(cp, dp, c, d);
                return ok;
            }

            if b < cp {
                ok = ok && okay(0, a as i32 - 1);
                ok = ok && okay(b as i32 + 1, cp as i32 - 1);
                ok = ok && okay(dp as i32 + 1, n as i32 / 2 - 1);
                ok = ok && chkc(a, b, ap, bp);
                ok = ok && chkc(cp, dp, c, d);
                return ok;
            }

            if dp < a {
                ok = ok && okay(0, cp as i32 - 1);
                ok = ok && okay(dp as i32 + 1, a as i32 - 1);
                ok = ok && okay(b as i32 + 1, n as i32 / 2 - 1);
                ok = ok && chkc(a, b, ap, bp);
                ok = ok && chkc(cp, dp, c, d);
                return ok;
            }

            if a < cp {
                ok = ok && okay(0, a as i32 - 1);
                ok = ok && okay(dp as i32 + 1, n as i32 / 2 - 1);
                ok = ok && spacp(a, b, c, d);
                return ok;
            }
            if cp < a {
                ok = ok && okay(0, cp as i32 - 1);
                ok = ok && okay(b as i32 + 1, n as i32 / 2 - 1);
                ok = ok && spcpa(a, b, c, d);
                return ok;
            }
            false
        };
        let mut hm = std::collections::HashMap::<Vec<i32>, bool>::new();
        queries
            .into_iter()
            .map(|x| match hm.entry(x.clone()) {
                std::collections::hash_map::Entry::Occupied(val) => *val.get(),
                std::collections::hash_map::Entry::Vacant(v) => *v.insert(ga(
                    x[0] as usize,
                    x[1] as usize,
                    x[2] as usize,
                    x[3] as usize,
                )),
            })
            .collect::<Vec<_>>()
    }
}
