    use super::*;

    #[test]
    fn test_1() {
        let s = "abcabc".to_string();
        let queries = [[1, 1, 3, 5], [0, 2, 5, 5]]
            .iter()
            .map(|x| x.to_vec())
            .collect::<Vec<_>>();
        let ans = vec![true, true];
        assert_eq!(ans, Solution::can_make_palindrome_queries(s, queries));
    }
